import React from "react";
import { Box, ThemeProvider } from "@material-ui/core";
import theme from "./theme/theme";
import Header from "./components/Header"


export default () =>{
  return (
    <ThemeProvider theme={theme}>
      <Box>
        <Header />
      </Box>
    </ThemeProvider>
  );
}
